(9, 'Tìm ước chung lớn nhất', 'Nhập 2 số nguyên từ bàn phím.In ra ước chung lớn nhất của 2 số đó', '23 12', '1', '34 12 ', '2', '48 36', '12', '100 525', '25', '144 12', '12', 'Hard'),
